■ メーカー:CHANEL シャネル<br>
■ 商品名 :イドゥラ ビューティ リップ バーム <br>
<br>
■ 内容量10g<br>
■付属：紙袋付き
■ 商品説明<br>
潤って、ふっくらと弾む唇へと整え、つややかさとボリュームをもたらすリップ バーム。 <br>
カメリア プレシャス オイル（サザンカ油）が、唇に潤いを与えます。リッチで濃密なテクスチャーが唇をやさしく包み込み、リップメークが美しく映えるつやめく唇へと導きます。
