リップクリーム／保湿用リップクリーム<br><br>１００％天然植物オイル新配合、ローズの優雅な香りとオーガニック植物の豊かな潤いで肌と心を満たします<br>とろり濃密なうるおいの滴で唇をグロストリートメント。咲きたての花びらのようにみずみずしいふっくらツヤ唇にみちびきます。<br><br>商品名：コーセーコスメポート ＊ローズオブヘブンリップエッセンス１０Ｇ <br><br>ローズＨ　リップＥ　１０Ｇ<br>ブランド：ロ－ズオブＨ<br><br>１００％天然植物オイル新配合、ローズの優雅な香りとオーガニック植物の豊かな潤いで肌と心を満たします<br><br> JAN：4971710382723<br>販売元：　コーセーコスメポート<p>とろり濃密なうるおいの滴でふっくらツヤ唇に<br><br>■ くちびるにブルガリア生まれのだダマスクローズの恵み<br><br>濃密なうるおいの滴で唇をグロストリートメント。咲きたての花びらのようにみずみずしいふっくらツヤ唇にみちびきます。 <br><br>■ 100％天然植物オイルを新配合<br><br>浸透感が高い、ローズ由来の天然植物オイルを新配合。ナチュラルなうるおいが肌の奥まで浸透し、長時間持続します。<br>ローズ種子由来のオイル：ローズヒップオイル <br><br>■ 響きあう ローズの祝福<br><br>ローズハニーを2倍配合。ほのかなローズの香り。<br>●ブルガリアンダマスクローズハニー2倍*<br>●ダマスクローズウォーター<br>●ローズ種子オイルSA<br>*既存品比 <br><br>■ オーガニック認証<br><br>限定産地で、有機栽培された植物から抽出した原料を、世界中から取り寄せて使用しています。<br>サフラワー抽出オイル(保湿)配合 <br><br><br>商品名 ローズオブヘブン　リップエッセンス　(リップ用美容液)<br>(RoseofHeaven　LIP ESSENCE) <br>ブランド ローズオブへブン(RoseofHeaven) <br><br><br>使用方法 <br>チューブを唇に直接あててのばすか、指先に適量を取ってお使いください。 <br><br>使用上の注意 <br>□ ご使用後は、チューブの口元をきれいにふき、キャップを必ずしめてください。<br>□ 高温の場所には置かないでください。<br>□ 傷やはれもの・湿しん等、お肌に異常があるときはお使いにならないでください。<br>使用中、赤味・はれ・かゆみ・刺激等の異常があらわれた場合は、使用を中止し、皮膚科専門医等へご相談ください。<br>そのまま使用を続けますと症状が悪化することがあります。 <br><br>成分 <br>ポリブテン、ミネラルオイル、ワセリン、リンゴ酸ジイソステアリル、トリメリト酸トリトリデシル、パルミチン酸デキストリン、トリイソステアリン酸ポリグリセリル-2、（パルミチン酸/オクタン酸）デキストリン、ラウロイルグルタミン酸ジ（オクチルドデシル/フィトステリル/ベヘニル）、ジメチルシリル化シリカ、サフラワー油、ジパルミチン酸アスコルビル、ダマスクバラ花水、トコフェロール、ハチミツ、ローズヒップ油、BG、DPG、シリカ、ジメチコン、ヘキサ（ヒドロキシステアリン酸/ステアリン酸/ロジン酸）ジペンタエリスリチル、水、フェノキシエタノール、香料 <br>&nbsp;<br>区分 日本製・化粧品 <br>　</p><br><br>CS：48<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
